(5, '1340 (2024004774)', 'SERV. IMPLEMENTACION DE UN SISTEMA DE CONTROL DE VELOCIDAD Y PROTECCION ANTE SOBREESFUERZOS EN EL SISTEMA DE TRANSMISION DE POTENCIA – EQUIPO: ESCALDADOR QUIMICO LINEA N°7', 'ECOSAC', 'MANUEL R.', '0000-00-00', '0000-00-00', 100.00, 'PENDIENTE', '<p>PENDIENTE REGULARIZAR OC</p>', '2024-09-14 02:51:13', '2024-09-14 02:52:21'),
(6, '1331 (2024004331)', 'SRV. DESMONTAJE, MANTENIMIENTO, INSTALACION Y CALIBRACION DE VALVULAS DE CONTROL DE PROCESOS DE AUTOCLAVE N°5', 'ECOSAC', 'ZAMORA', '0000-00-00', '0000-00-00', 100.00, 'FINALIZADO', '<ul><li>EL 16-SET SE ENVIO INFORMACIÓN AL CLIENTE PARA REGULARIZAR PAGO</li><li>HOY 13-SET SE ESPERA QUE TERMINEN TODO EL SERVICIO.</li><li>CONSULTAR QUE SE VA HACER PARA TERMINAR TODO.</li><li>TENER LISTO EL ACTA DE ENTREGA.</li><li>TENER LISTO EL INFORME.</li></ul>', '2024-09-14 02:54:11', '2024-09-16 20:13:28'),
(7, '1356', 'MONTAJE DE MEDIDORES MÁSICOS SAGE PARA FLUJO DE GAS NATURAL', 'GLOBAL CITRUS', 'ANTHONY ZAMORA', '2024-09-16', '2024-09-20', 100.00, 'PENDIENTE', '<ul><li>YA SE ENVIO AL CLIENTE, VALIDAR SI YA CANCELO EN CLIENTE.</li><li>PENDIENTE ENVIAR INFORME Y ACTA DE CONFORMIDAD AL CLIENTE.</li><li>PENDIENTE ACTUALIZAR INFORMACIÓN.</li><li>1356 YA ESTA EJECUTANDOSE HOY 10-SET DEBE CULMINARSE AL 100%</li></ul>', '2024-09-14 02:55:27', '2024-10-04 00:34:00'),
(8, '1232', 'SERVICIO DE MANTENIMIENTO DE 2 MOTORES 3HP Y 20 HP.', 'LADRILLOS INKA FORTE S.A.C.', 'ZAMORA', '0000-00-00', '0000-00-00', 100.00, 'PENDIENTE', '<ul><li>PENDIENTE QUE EL CLIENTE RECOJA EL MOTOR.</li><li>MODIFICAR EL INFORME FINAL SOBRE LA OC.</li><li>REALIZAR LA GUIA. <strong>(LA GUIA LA TIENE LISTA DIANA)</strong></li><li>UNA VEZ EL CLIENTE RECOJA EL MOTOR, REALIZAR LA FACTURA DEL 50% PENDIENTE.<br><br></li></ul>', '2024-09-16 19:54:37', '2024-09-16 20:29:54'),
(9, '1365', 'SERV DE ATENCION DE EMERGENCIA TECNICA', 'ECOSAC', 'MANUEL R. & MILTON F. ', '2024-08-31', '2024-08-31', 100.00, 'PENDIENTE', '<ul><li>VERIFICAR SI YA SE ENVIO TODA LA DOCUMENTACIÓN AL CLIENTE, Y VALIDANDO EL PAGO.</li><li>NOMBRE: CAMBIO DE SENSOR INDUCTIVO POR CAPACITIVO PEPPER+FUCHS</li><li>INFORME YA SE REALIZO.</li><li>VERIFICAR SI ES DE SUBIR MAS INFORMACIÓN AL NEXTCLOUD</li></ul>', '2024-09-16 20:28:43', '2024-09-16 20:45:06'),
(10, '1338 (2024005049)', 'SERV. PRUEBAS DE OPERATIVIDAD DE VALVULAS ALTERNATIVAS, MONTAJE Y CALIBRACION - PARA PUESTA EN MARCHA DE AUTOCLAVE N°5', 'ECOSAC', 'ZAMORA', '0000-00-00', '0000-00-00', 100.00, 'PENDIENTE', '<ul><li>SE ENVIO TODA LA DOCUMENTACIÓN AL CLIENTE, PENDIENTE REGULARIZAR PAGO.</li><li>MODIFICAR EL TITULO DE LA 1338</li><li>EN LA HOJA 9, SUMINISTÓ, NO HAY FOTOS DEBERIA DE VER FOTOS</li><li>COMO SUMINISTRO SOLO HAY TEXTO, DEBERA IR FOTOS</li><li>SCANEAR LA GUIA DE REMISION DE LA VALVULA DE 3/4</li><li>CONSULTAR SI HAN CALIBRADO, DEBERA VER PROTOCOLO DE PRUEBAS.</li></ul>', '2024-09-16 20:32:48', '2024-09-16 20:33:37'),
(11, '1358', 'ALQUILER E INSTALACIÓN DE EQUIPOS PARA PRUEBAS PILOTO DE EVAPORACIÓN DE JUGO', 'GLOBAL CITRUS', 'MILTON F. ', '2024-08-23', '2024-09-21', 0.00, 'FINALIZADO', '<ul><li>PENDIENTE CAMBIO DE VALVULA E INSTALAR UNA PANTALLA HMI.</li></ul>', '2024-09-16 21:22:00', '2024-10-22 20:08:10'),
(12, '1360', 'REUBICACIÓN DEL TABLERO DE CONTROL DE ARRANQUE DE BOMBA DE LUBRICACIÓN DE CHANCADORA', 'CPL', 'CARLOS R. & MANUEL R.', '2024-09-14', '2024-09-16', 95.00, 'PENDIENTE', '<ul><li>MILTON YA REALIZO EL INFORME FINAL, QUEDA PENDIENTE EL ACTA Y FORMATO DE ACEPTACIÓN.</li><li>EL SERVICIO YA SE EJECUTO, QUEDA PENDIENTE REALIZAR EL INFORME FINAL.</li><li>VERIFICAR QUIEN VA A REALIZAR EL INFORME FINAL.</li></ul>', '2024-09-16 21:34:24', '2024-09-24 02:20:02'),
(13, '1304', 'PROYECTO SULFÚRICO EN CONTROL', 'GAT', 'ANTHONY ZAMORA', '2024-10-01', '2024-10-16', 65.00, 'EN EJECUCIÓN', '<p>PERSONAL:&nbsp;</p><p>REALIZAR CANALIZADO: EN 15 DÍAS, CRISTHIAN, JACKSON, LEON, JUAN CARLOS .</p><p>ELECTRICISTAS: CALEB, BRAYER.</p><p>REALIZAR TABLERO DE CONTROL:</p>', '2024-09-19 01:26:45', '2024-10-10 01:29:22'),
