(1, 13, '2024-10-01', 'DESMOVILIZACION DE MATERIALES Y HERRAMIENTAS', '<p>SE REALIZO LA DESCARGA DE MATERIALES Y HERRAMIENTAS, CON 5 TECNICOS.</p>', 'ZAMORA', '1', 'GLB', 'images/01JJQFAB6F6QWF0JGVHBFVFCYW.png', 'images/01JJQFAB6M86KK6KMQ36K3SWD3.png', NULL, NULL, NULL, NULL, '2024-10-02 04:02:14', '2025-01-29 03:08:13'),
(3, 13, '2024-10-01', 'SUBIR TUBERIA INOX DE 2\" X 6M', '<p>MONTAJE Y DESMONTAJE DE ANDAMIOS 6 METROS.</p><p>SE REALIZO EL IZAJE Y POSICIONAMIENTO DE TUBERIA LINEAL 24 METROS EN 1 HORA Y 30 MINUTOS.</p>', 'ZAMORA', '4', 'UND', 'images/01J955F8VDM4MJSW0GS6WC6AVK.jpeg', 'images/01J955F8Y74SJD5G83YKA2FXQ0.jpeg', 'images/01J955F91X72JRHSK5P0YFZF9T.jpeg', 'images/01J955F966Y2HF61K8SQFEBP19.jpeg', 'images/01J99Y5TM4WTBM7F3KATP24RNA.jpeg', 'images/01J99Y5TMVFS2XQ93XFAZZFPKG.jpeg', '2024-10-02 04:08:30', '2024-10-04 00:37:13'),
(4, 13, '2024-10-02', 'ARMADO Y SOLDEO DE TUBERIA INOXIDABLE DE 2\".', '<p>ARMADO DE ANDAMIOS 2 CUERPOS Y MEDIO.</p><p>SE REALIZO 4 PEGAS DE 6.28\"&nbsp; TOTALIZANDO EN 25.12\" LA PEGA DEL DIA DE HOY.</p><p>2 PEGAS FUERON CON CAMARA DE GAS Y 2 CON ACCESORIOS SOCKET WELLD.</p><p>SE REALIZO UNA CAMARA DE GAS PARA PROCEDER A SOLDAR TUBERIA.&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><p>HABILITACIÓN DE NIPLES PARA ARMADO DE LINEAS DE DESCARGA HACIA REACTOR #4.&nbsp; &nbsp;</p><p>SE REALIZO 7 PEGAS DE 6.28\", TOTALIZANDO EN 43.96\" LA PEGA DEL DIA 03-10-24, 3 CODO SOCKET WELD Y 2 BRIDAS SOCKET WELD.</p><p>35% DE AVANCE</p>', 'ZAMORA', '1', 'GLB', 'images/01J97XFKP5E098YT5G35HD0SHT.jpeg', 'images/01J97XFKS82KGC0AF0KKA5K04A.jpeg', 'images/01J97XFKYG0ZNF42E0BZGDAWQK.jpeg', 'images/01J97XFM34DJ886P0YWCEXWFJT.jpeg', 'images/01J97XFM6NAMDFCGT5B55ZD9FR.jpeg', 'images/01J97XFM8WXXHR19ASG29P2KVR.jpeg', '2024-10-03 05:46:36', '2024-10-05 01:06:59'),
(5, 13, '2024-10-02', 'ARMADO Y MONTAJE Y CONEXIONADO DE TABLERO INOXIDABLE DE INSTRUMENTACIÓN ', '<p>FABRICACIÓN DE SOPORTERIA Y SOLDEO.</p><p>PINTADO DE SOPORTERIA.</p><p>ARMADO DE TABLERO PARA ELECTROVALVULAS.</p><p>PERFORACIÓN DE 4 AGUJEROS EN TABLERO.</p><p>MONTAJE DE TABLERO INOX.</p><p>COLOCACIÓN DE TUBERIA FLEXIBLE DE 1\" , 1 METRO.</p><p>COLOCACIÓN DE 4 CONECTORES RECTOS.</p><p>PERFORACION DE 3 AGUJEROS Y COLOCACION DE PASAMUROS.</p><p>CABLEADO DE CABLE DE CONTROL 10X2.5MM, 2 TERNAS DE 30 METROS DESDE CAMPO HACIA PLC.</p><p>CABLEADO DE CABLE DE CONTROL 7X2.5MM, 12 METROS DESDE T. FUERZA&nbsp; HACIA PLC.</p><p>PEINADO DE CABLEADO.</p><p>TENDIDO DE CABLE SHIELD.</p><p>TENDIDO DE MANGUERA NEUMATICA.</p><p>&nbsp;70% DE AVANCE</p>', 'ZAMORA', '1', 'GLB', 'images/01J97YBPC8XKNY2FFDA34Q24YQ.jpeg', 'images/01J97YBPFYB450KT9HVX6N46N9.jpeg', 'images/01J97YBPM6T36CTM28Q9A8NZNF.jpeg', 'images/01J97YBPR3HBH3PEXXTFHJV7J0.jpeg', 'images/01J97YBPWSJJCX5T6KJ71CZM6X.jpeg', 'images/01J9AH2VX2M22RNWWSWRJ77KDM.jpeg', '2024-10-03 06:01:57', '2024-10-09 19:53:53'),
(6, 13, '2024-10-02', 'ARMADO DE SOPORTERIA BASE PARA IBC', '<p>HABILITACIÓN DE ANGULO PARA SOPORTERIA.</p><p>APUNTALADO DE SOPORTERIA.&nbsp;</p><p>ARMADO Y SOLDEO DE SOPORTERIA.</p><p>SOLDEO DE PLANCHA BASE. &nbsp;</p><p>PINTADO DE SOPORTERIA.&nbsp;</p><p>POSICIONAMIENTO EN PUNTO DE TRABAJO.&nbsp; &nbsp; &nbsp; &nbsp;90% DE AVANCE</p>', 'ZAMORA', '1', 'UND', 'images/01J97YJ6NXHMBY9MM4VAW7HXF0.jpeg', 'images/01J97YJ6P1Q20Q52QGCMV8BM1P.jpeg', 'images/01J97YJ6P3TFZ4W756NRCS1NP7.jpeg', NULL, 'images/01J9AH4WDAEDV6RK4NDV5YH7CP.jpeg', 'images/01J9AH4WDESC1B4TFHB1N1GG3F.jpeg', '2024-10-03 06:05:29', '2024-10-05 01:07:35'),
(7, 13, '2024-10-03', 'PRUEBAS DE TINTE PENETRANTE.', '<p>SE REALIZO PRUEBAS A 4 PEGAS DE 6.28\" SIGUIENDO LOS PASOS DETALLADOS.</p><p>LIMPIEZA DE PUNTO SOLDADO,COLOCACIÓN DE PENETRANTE SE DEJO ACTUAR 8 MINUTOS, LIMPIEZA CON SOLVENTE Y COLOCACIÓN DE REVELADOR.</p><p><br></p><p>&nbsp;</p>', 'ZAMORA', '1', 'GLB', 'images/01J9AGH0CDYHBXGCRYCCCET0GT.jpeg', 'images/01J9AGH0D0DQQ93JP30HSY7JYB.jpeg', 'images/01J9AGH0GNCYSQJR9VMW65DHDR.jpeg', 'images/01J9AGH0KMQKEHMDJZEAWTZVZP.jpeg', 'images/01J9AGH0PXXVTK6WGKQ6XB23HW.jpeg', 'images/01J9RW91E2S5CS3QZXZF30GSQJ.jpeg', '2024-10-04 05:45:19', '2024-10-09 19:52:37'),
(8, 13, '2024-10-03', 'FIJACION DE TUBERIA INOXIDABLE DE 2\"', '<p>SE REALIZO PERFORACIÓN DE AGUJEROS PARA COLOCACION DE 5 ABRAZADERAS UBOLT.</p><p>SE REALIZO MONTAJE DE 1 SOPORTE PARA SUJECCIÓN DE TUBERIA.</p><p>SE REALIZO EL PINTADO DE SOPORTERIA.</p>', 'ZAMORA', '1', 'GLB', 'images/01J9AGXHG8FGSNY1CN1FGARN94.jpeg', 'images/01J9AGXHGCESKXBTQ0R9BP05RE.jpeg', NULL, NULL, NULL, NULL, '2024-10-04 06:04:44', '2024-10-04 06:04:44'),
(9, 13, '2024-10-04', 'ARMADO, MONTAJE Y CONEXIONADO DE TABLERO FUERZA', '<p>SE REALIZO LA FABRICACIÓN DE SOPORTERIA PARA LA TUBERIA CONDUIT.</p><p>PINTADO DE SOPORTERIA.</p><p>CANALIZADO DE TUBERIA CONDUIT DE 1\", 9 METROS.</p><p>CABLEADO DE CABLE FUERZA 4X4MM 100 METROS.</p><p>MONTAJE DE SOPORTERIA RIEL UNISTRUT.</p><p>MONTAJE DE TABLERO.</p><p>ARMADO DE TABLERO DE FUERZA.</p><p>CONEXIONADO DE TABLERO DE FUERA Y CONTROL.</p><p><br></p><p><br></p>', 'ZAMORA', '1', 'GLB', 'images/01J9RWF8W2SJE6NRZ23CHJHM58.jpeg', 'images/01J9RWF8W6HYX5597SRV9W9BYQ.jpeg', 'images/01J9RWF8WARHWASJR0M9DXGMXN.jpeg', 'images/01J9RWF8WDXR7NEQPR6FJBEZ2A.jpeg', 'images/01J9RWF8WGJXB2GQPRQ9CZEDD5.jpeg', 'images/01J9RWF8WKJKVQ8AGWE89RXTAM.jpeg', '2024-10-05 01:11:02', '2024-10-09 19:56:01'),
(10, 13, '2024-10-09', 'MONTAJE DE VALVULAS MANUALES Y AUTOMATICAS.', '<p>SE REALIZO EL MONTAJE DE 2 VALVULAS MANUALES Y 2 VALVULAS AUTOMATICAS.</p>', 'ZAMORA', '1', 'GLB', NULL, NULL, NULL, NULL, NULL, NULL, '2024-10-09 19:57:13', '2024-10-09 19:57:13'),
(11, 13, '2024-10-21', 'TENDIDO DE CONDUCTOR 5G2.5MM2', '<p>LA ACTIVIDAD SE REALIZO EN 3 HORAS</p><p>SE TENDIERON 3 TERNAS POR EL MISMO RECORRIDO DE 35 M</p><p>SE TENDIO POR BANDEJA, NO INCLUYE CANALIZADO</p><p>LA ACTIVIDAD SE REALIZO CON 3 TECNICOS ELECTRICOS Y APOYO PARCIAL DEL SUPERVISOR</p><p><br></p>', 'MANUEL R.', '35', 'MTS', 'images/01JAS1A4ZMV71DQXT77MV59G7Q.jpg', 'images/01JAS1A55W5AYMGV5Y9EQWCB1N.jpg', 'images/01JAS1A59M62XSBYZGBQ5NPKXA.jpg', NULL, NULL, NULL, '2024-10-22 07:36:19', '2024-10-22 07:44:57'),
(12, 13, '2024-10-21', 'SOLDEO DE 10 PEGAS - AMPLIACION DE SOPORTE IBC', '<p>LA ACTIVIDAD DURO 3.5 HORAS</p><p>LA ACTIVIDAD INCLUYE CORTE Y DESVASTE DE LAS PIEZAS</p><p>LA DESARROLLARON 1 SOLDADOR + 1 ASISTENTE</p>', 'MANUEL R.', '10', 'UND', 'images/01JAS1RDN6NR045FCN0NN9GXXJ.jpg', 'images/01JAS1RDN9PY3Y1D47V2Q4R0MF.jpg', 'images/01JAS1RDTN525RX41PS50VCGM4.jpg', NULL, NULL, NULL, '2024-10-22 07:44:06', '2024-10-22 07:44:06'),
(13, 13, '2024-10-23', 'PINTADO DE SOPORTE IBC', '<p>LA ACTIVIDADE DURO 3.5 HORAS.</p><p>EL SECADO DEL SOPORTE DEMORO 5 HORAS.</p><p>SE UTILIZO PINTURA EPOXICA PLOMA Y NARANJA</p><p>LA ACTIVIDAD SE REALIZO CON SUPERVISION PARCIAL Y 02 TECNICOS</p>', 'MANUEL R.', '01', 'UND', 'images/01JAX1GQ7ZWPH6P4AHF8Q2K72B.jpg', 'images/01JAX1GQFXP49NPBFGV5A8W3WY.jpg', 'images/01JAX1GQM420TRQJ1Z372A189N.jpg', NULL, NULL, NULL, '2024-10-23 20:56:52', '2024-10-23 20:56:52'),
(14, 13, '2024-10-22', 'CONEXIONADO DE TABLERO DE CONTROL (LOGICA DE RELES) Y MONTAJE EN PARED', '<p>SE REALIZO EL CONEXIONADO SEGUN DIAGRAMA DE TABLERO ELECTRICO PEQUEÑO, CON 03 RELES. Y UNA FUENTE; y se realizo la interconexión entre tableros de control y paso.</p><p>LA ACTIVIDAD DURO 4.5 HORAS.</p><p>SE REALIZO CON SUPERVISION TOTAL Y CON 02 TECNICOS ELECTRICOS</p>', 'MANUEL R.', '01', 'GLB', 'images/01JAX1PEK986Y23VEKJBQXGEQY.jpg', 'images/01JAX1PEKCY3THJDRXW8HW6N87.jpg', 'images/01JAX1PEKV5R8M5F7D0D9CV6DA.jpg', 'images/01JAX1PESHSMJ0ZSGT6Y6XH031.jpg', NULL, NULL, '2024-10-23 20:59:59', '2024-10-23 20:59:59'),
